"☣ | DR. PINKYS LAB",
"❣ | PEPPERMINTFEST SCENES     ",
"☽ | MOONFEST SCENES",
"Σ | GEEK MONTH SCENES     ",
"✴ | SUMMER SOLSTICE SCENES",
"⚰ | DANSE SCENES/AUTUMN     ",
"⚙ | STEAMPUNK SOCIETY",
"☃ | WINTERFEST SCENES     ",
"♬ | NEW YEARS     ",
"☂ | SPRING PUMAS     ",
"✂ | [EC]  ",
" ☐ | [FG]  ",
"☁ | EM'S RAINBOWS    ",
